#Simple O(n^2) method is as follows(This has worst performance out of three):
class Solution(object):
    def isIsomorphic(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        a = b = ''
        c= d = True
        if s ==t:
            return True
        for i in xrange(0,len(s)):
            a = s[i]
            b = t[i]
            for j in xrange(i+1,len(s)):
                if s[j] == a:
                    if t[j] != b:
                        c = False
        for i in xrange(0,len(s)):
            a = s[i]
            b = t[i]
            for j in xrange(i+1,len(s)):
                if t[j] == b:
                    if s[j] != a:
                        d = False
        if c == True and d == True:
            return True
        else:
            return False

